import React from 'react';
import { Link } from 'react-router-dom';
import articles from '../article-content';

const ArticlesList = () => {
    return (
        <div>
           <h1>Articles List</h1> 
           {articles.map(article=>(<h3>{article.title}</h3>))}
        </div>
    );
};

export default ArticlesList;
